function findCharge(price,amount){let fprice=price,discount=void 0,fee=void 0;return discount=.1*fprice,fprice-=discount,fprice*=amount,fee=.25*fprice,fprice+=fee,fprice=Math.round(fprice),fprice}function myTurnout(price,amount){let fprice=price,discount=void 0,fee=void 0;return discount=.1*fprice,fprice-=discount,fprice*=amount,fee=.25*fprice,fprice=fee,fprice=Math.round(fprice),fprice}function calculate(){var itemAmount=document.getElementById("ipt1").value,itemCost=document.getElementById("ipt2").value,totalCost=0,serviceFee=0,calculatorResult=document.getElementById("calculatorResult");totalCost=findCharge(itemAmount,itemCost),serviceFee=myTurnout(itemAmount,itemCost),calculatorResult.innerHTML="<p>Your service fee is <u>"+serviceFee+"</u> gp.</p><br><p>You will charge <u>"+totalCost+"</u> gp.</p>"}